import React from 'react';
import '../../App.css';
import { Link } from 'react-router-dom';
import newArrival1 from '../../images/new-arrival-1.png';
import newArrival2 from '../../images/new-arrival-2.png';
import newArrival3 from '../../images/new-arrival-3.png';


class Newproducts extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container new-arr'>
					<div className='row'>
						<div className='col-lg-6 col-sm-10 mx-auto'>
							<img src={newArrival1} alt='image' className='new-arrival-img-1'/>
						</div>
						<div className='col-lg-3 col-sm-3 mx-auto'>
							<img src={newArrival2} alt='image'className='new-arrival-img-2'/>
						</div>
						<div className='col-lg-3 col-sm-3 mx-auto'>
							<img src={newArrival3} alt='image'className='new-arrival-img'/>
						</div>
					</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Newproducts;
